import React, { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";
function App() {
  const [post, setPost] = React.useState(null);
  useEffect(() => {
    axios.get("/api/menu/items/").then((response) => {
      setPost(response.data);
    });
  }, []);

  if (!post) return null;
  const noteItems = post.map((curpost) =>
    <div>
      <h1>{curpost.title}</h1>
      <p>{curpost.description}</p>
      <button onClick={useEffect(() => {
        axios.delete("/api/menu/items/" + curpost.id)
      }, [])
      }>Delete</button>
    </div>
  );
  return (
    <ul>{noteItems}</ul>

  );
}
export default App;
